export function BehanceButton({ href }: { href: string }) {
  return (
    <a href={href} target="_blank" rel="noopener noreferrer">
      <button className="w-[45px] h-[45px] flex items-center justify-center border-none bg-transparent relative rounded-[7px] cursor-pointer transition-all duration-300 group">
