          </svg>
        </span>
        <span className="absolute w-full h-full bg-[#1769ff] z-[1] rounded-[10px] pointer-events-none transition-all duration-300 group-hover:rotate-[35deg] origin-bottom" />
      </button>
    </a>
  );
}

